(2, 3, '2014-01-24 12:31:30', '2014-01-24 12:31:30', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin'' caught in the rain.)</blockquote>\r\n...or something like this:\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\nAs a new WordPress user, you should go to <a href="http://anggo.local/cabang.hmi.or.id/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'open', 'open', '', 'sample-page', '', '', '2014-07-18 19:56:16', '2014-07-18 12:56:16', '', 0, 'http://anggo.local/cabang.hmi.or.id/?page_id=2', 0, 'page', '', 0),
(5, 3, '2014-01-24 12:56:09', '2014-01-24 12:56:09', '<p lang="en-US" style="text-align: left;" align="CENTER"><span style="line-height: 1.5em;">Kecamatan Bayan merupakan salah satu kecamatan di Kabupaten Lombok Utara yang mempunyai luas wilayah 329 Km2 atau sekitar 40,65% dari total luas wilayah Kabupaten Lombok Utara. Secara geografis Kecamatan Bayan terletak diantara 08°30’00” LS – 08°10’00” LS dan 116°18’00” BT – 115°30’30” BT atau dengan batas-batas sebagai berikut:</span></p>\r\n\r\n<ul>\r\n	<li>\r\n<p lang="en-US">Sebelah Utara: Laut Bali</p>\r\n</li>\r\n	<li>\r\n<p lang="en-US">Sebelah Timur: Kabupaten Lombok Timur</p>\r\n</li>\r\n	<li>\r\n<p lang="en-US">Sebelah Selatan: Kabupaten Lombok Tengah</p>\r\n</li>\r\n	<li>\r\n<p lang="en-US">Sebelah Barat: Kecamatan Kayangan</p>\r\n</li>\r\n</ul>\r\n<p lang="en-US"> Kecamatan Bayan terdiri dari 8 desa/kelurahan yaitu: Desa Akar-akar, Anyar, Bayan, KarangBajo, Loloan, MumbulSari, SambikElen, Senaru, dan Sukadana yang terbagi menjadi 94 dusun/banjar.</p>\r\n<p lang="en-US"><a href="http://anggo.local/kec.bayan/?page_id=108"><img class="size-full wp-image-318 alignright" alt="button_read-more-blue" src="http://anggo.local/kec.bayan/wp-content/uploads/2014/01/button_read-more-blue.png" width="140" height="39" /></a></p>\r\n&nbsp;\r\n\r\n&nbsp;', 'Homepage', '', 'publish', 'open', 'open', '', 'homepage', '', '', '2014-07-19 16:42:00', '2014-07-19 09:42:00', '', 0, 'http://anggo.local/cabang.hmi.or.id/?page_id=5', 0, 'page', '', 0),
