(41, 1, '2014-07-19 16:13:43', '2014-07-19 09:13:43', '<p lang="en-US" style="text-align: left;" align="CENTER"><span style="line-height: 1.5em;">Kecamatan Bayan merupakan salah satu kecamatan di Kabupaten Lombok Utara yang mempunyai luas wilayah 329 Km2 atau sekitar 40,65% dari total luas wilayah Kabupaten Lombok Utara. Secara geografis Kecamatan Bayan terletak diantara 08°30’00” LS – 08°10’00” LS dan 116°18’00” BT – 115°30’30” BT atau dengan batas-batas sebagai berikut:</span></p>\n\n<ul>\n	<li>\n<p lang="en-US">Sebelah Utara: Laut Bali</p>\n</li>\n	<li>\n<p lang="en-US">Sebelah Timur: Kabupaten Lombok Timur</p>\n</li>\n	<li>\n<p lang="en-US">Sebelah Selatan: Kabupaten Lombok Tengah</p>\n</li>\n	<li>\n<p lang="en-US">Sebelah Barat: Kecamatan Kayangan</p>\n</li>\n</ul>\n<p lang="en-US"> Kecamatan Bayan terdiri dari 8 desa/kelurahan yaitu: Desa Akar-akar, Anyar, Bayan, KarangBajo, Loloan, MumbulSari, SambikElen, Senaru, dan Sukadana yang terbagi menjadi 94 dusun/banjar. Peta administrasi Kecamatan Bayan dapat dilihat pada Gambar berikut;</p>\n<p lang="en-US"></p>', 'Homepage', '', 'inherit', 'open', 'open', '', '5-autosave-v1', '', '', '2014-07-19 16:13:43', '2014-07-19 09:13:43', '', 5, 'http://anggo.local/cabang.hmi.or.id/?p=41', 0, 'revision', '', 0),
