(300, 1, '2014-07-19 02:32:08', '2014-07-18 19:32:08', '<p lang="en-US" style="text-align: left;" align="CENTER"><b style="text-align: left; line-height: 1.5em;">Kondisi Geografis Kecamatan Bayan</b></p>\r\n<p lang="en-US" align="JUSTIFY">Kecamatan Bayan merupakan salah satu kecamatan di Kabupaten Lombok Utara yang mempunyai luas wilayah 329 Km<sup>2</sup> atau sekitar 40,65% dari total luas wilayah Kabupaten Lombok Utara. Secara geografis Kecamatan Bayan terletak diantara 08°30’00” LS – 08°10’00” LS dan 116°18’00” BT – 115°30’30” BT atau dengan batas-batas sebagai berikut:</p>\r\n\r\n<ul>\r\n	<li>\r\n<p lang="en-US">Sebelah Utara: Laut Bali</p>\r\n</li>\r\n	<li>\r\n<p lang="en-US">Sebelah Timur: Kabupaten Lombok Timur</p>\r\n</li>\r\n	<li>\r\n<p lang="en-US">Sebelah Selatan: Kabupaten Lombok Tengah</p>\r\n</li>\r\n	<li>\r\n<p lang="en-US">Sebelah Barat: Kecamatan Kayangan</p>\r\n</li>\r\n</ul>\r\n<p lang="en-US"> Kecamatan Bayan terdiri dari 8 desa/kelurahan yaitu: Desa Akar-akar, Anyar, Bayan, KarangBajo, Loloan, MumbulSari, SambikElen, Senaru, dan Sukadana yang terbagi menjadi 94 dusun/banjar. Peta administrasi Kecamatan Bayan dapat dilihat pada Gambar berikut;</p>\r\n<p lang="en-US"><a href="http://anggo.local/kec.bayan/wp-content/uploads/2014/02/kecamatan_bayan.png"><img class="alignnone size-large wp-image-298" alt="kecamatan_bayan" src="http://anggo.local/kec.bayan/wp-content/uploads/2014/02/kecamatan_bayan-773x1024.png" width="770" height="1020" /></a></p>\r\n<p lang="en-US" style="text-align: center;"></p>\r\n<p lang="en-US"><b>Wilayah </b><b>A</b><b>dministratif</b></p>\r\n<p lang="en-US" align="JUSTIFY">Penduduk Kecamatan Bayan menempati permukiman dengan pola mengelompok atau terpusat. Berdasarkan peta administrasi Kecamatan Bayan skala 1:26.000 dan didukung oleh data pengamatan lapangan, lokasi permukiman mengelompok pada pusat kecamatan sebagai sentral pemerintahan. Luas dari setiap desa/kelurahan dapat dilihat pada Tabel berikut.</p>\r\n&nbsp;\r\n<table width="316" cellspacing="0" cellpadding="7"><colgroup> <col width="143" /> <col width="60" /> <col width="69" /> </colgroup>\r\n<tbody>\r\n<tr>\r\n<td bgcolor="#ffffff" width="143" height="5">\r\n<p lang="en-US"><span style="font-size: small;"><b>Desa</b></span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;"><b>Luas</b></span><span style="font-size: small;"><b>(ha)</b></span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;"><b>Persen</b></span><span style="font-size: small;"><b>(%)</b></span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Akar akar</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">4680</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">17.81</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Anyar</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">979</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">3.73</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Bayan</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">2379</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">9.05</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Karang bajo</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">379</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">1.44</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Loloan</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">3702</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">14.09</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Mumbul sari</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">1936</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">7.37</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Sambik elen</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">3519</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">13.39</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Senaru</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">3438</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">13.08</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Sukadana</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">5266</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">20.04</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="5"></td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">26278</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">100</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n<p lang="en-US">Desa/kelurahan yang memiliki luas wilayah paling luas adalah Desa sukadana dengan luas wilayah 5266 atay 20, 04% dari luas total kecamatan Bayan. Sementara itu, desa/kelurahan yang memiliki luas wilayah paling kecil adalah Kelurahan Karangbajo dengan luas wilayah 379 hektar atau sebesar 1,44 % dari luas wilayah Kecamatan Bayan.</p>\r\n<p lang="en-US"><b>Struktur Organisasi</b></p>\r\n<p lang="en-US" style="text-align: center;"><a href="http://anggo.local/kec.bayan/wp-content/uploads/2014/02/struktur_bayan.png"><img class="alignnone size-full wp-image-299" alt="struktur_bayan" src="http://anggo.local/kec.bayan/wp-content/uploads/2014/02/struktur_bayan.png" width="905" height="572" /></a></p>', 'Profile Kecamatan Bayan', '', 'inherit', 'open', 'open', '', '108-revision-v1', '', '', '2014-07-19 02:32:08', '2014-07-18 19:32:08', '', 108, 'http://anggo.local/kec.bayan/?p=300', 0, 'revision', '', 0);
