l;">379</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">1.44</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Loloan</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">3702</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">14.09</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Mumbul sari</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">1936</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">7.37</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Sambik elen</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">3519</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">13.39</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Senaru</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">3438</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">13.08</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="6">\r\n<p lang="en-US"><span style="font-size: small;">Sukadana</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">5266</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">20.04</span></p>\r\n</td>\r\n</tr>\r\n<tr valign="BOTTOM">\r\n<td bgcolor="#ffffff" width="143" height="5"></td>\r\n<td bgcolor="#ffffff" width="60">\r\n<p lang="en-US"><span style="font-size: small;">26278</span></p>\r\n</td>\r\n<td bgcolor="#ffffff" width="69">\r\n<p lang="en-US"><span style="font-size: small;">100</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n<p lang="en-US">Desa/kelurahan yang memiliki luas wilayah paling luas adalah Desa sukadana dengan luas wilayah 5266 atay 20, 04% dari luas total kecamatan Bayan. Sementara itu, desa/kelurahan yang memiliki luas wilayah paling kecil adalah Kelurahan Karangbajo dengan luas wilayah 379 hektar atau sebesar 1,44 % dari luas wilayah Kecamatan Bayan.</p>\r\n<p lang="en-US"></p>\r\n<p lang="en-US"><b>Struktur Organisasi</b></p>\r\n<p lang="en-US" style="text-align: center;"><a href="http://anggo.local/kec.bayan/wp-content/uploads/2014/02/struktur_bayan.png"><img class="alignnone size-full wp-image-299" alt="struktur_bayan" src="http://anggo.local/kec.bayan/wp-content/uploads/2014/02/struktur_bayan.png" width="905" height="572" /></a></p>', 'Profile Kecamatan Bayan', '', 'inherit', 'open', 'open', '', '108-revision-v1', '', '', '2014-07-19 02:32:56', '2014-07-18 19:32:56', '', 108, 'http://anggo.local/kec.bayan/?p=301', 0, 'revision', '', 0),
